import React, { useState } from 'react';
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  min-height: 100vh;
  padding: 25px;
  background-color: #D3E8F7;
  box-sizing: border-box;
`;

const Question = styled.div`
  font-size: 20px;
  font-family: "Pretendard-ExtraBold";
  color: #252A2F;
`;

const Message = styled.div`
  font-size: 13px;
  font-family: "Pretendard-Medium";
  color: #252A2F;
`;

const SurveyContainer = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  gap: 10%;
  margin-top: 5%;
`;

const SurveyButton = styled.button`
  background-color: ${props => (props.selected ? '#83a5c6' : 'white')};
  color: ${props => (props.selected ? 'white' : '#252A2F')};
  border: none;
  border-radius: 10px;
  width: 35%;
  height: 35px;
  font-size: 16px;
  font-family: "Pretendard-ExtraBold";
`;

const LikertContainer = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  gap: 7%;
  margin-top: 5%;
`;

const LikertButton = styled.button`
  background-color: ${props => (props.selected ? '#83a5c6' : 'white')};
  color: ${props => (props.selected ? 'white' : '#252A2F')};
  width: 15px;  /* Adjusted size for better visibility */
  height: 15px;
  border-radius: 50%;
  border: 0.5px solid #252A2F;
  cursor: pointer;  /* Cursor change on hover */
`;

const Divider = styled.hr`
  border: none;
  height: 0.5px;
  background-color: #252a2f;
  width: 100%;
`;

const ButtonContainer = styled.div`
  margin-top: 5%;
  display: flex;
  justify-content: right;
`;

const Button = styled.button`
  width: 25%;
  height: 30px;
  margin: 10px;
  background-color: #ffffff;
  border-radius: 20px;
  font-family: "Pretendard-ExtraBold";
  border: none;
  box-shadow: 0 0 2px rgba(0, 0, 0, 0.1);
  font-size: 15px;
  color: #6d9bca;
`;

const TasteSurvey = () => {
  const [selectedButtons, setSelectedButtons] = useState(Array(6).fill(false));
  const [selectedLikert, setSelectedLikert] = useState(0);

  const handleClick = (index) => {
    const newSelectedButtons = [...selectedButtons];
    newSelectedButtons[index] = !newSelectedButtons[index];
    setSelectedButtons(newSelectedButtons);
  };

  const handleLikert = (index) => {
    setSelectedLikert(index);
  };

  return (
    <Container>
      <Question>어떤 여행을 주로 다니셨나요?</Question>
      <SurveyContainer>
        <SurveyButton
          selected={selectedButtons[0]}
          onClick={() => handleClick(0)}
        >
          단거리
        </SurveyButton>
        <SurveyButton
          selected={selectedButtons[1]}
          onClick={() => handleClick(1)}
        >
          원거리
        </SurveyButton>
      </SurveyContainer>
      <SurveyContainer>
        <SurveyButton
          selected={selectedButtons[2]}
          onClick={() => handleClick(2)}
        >
          휴식
        </SurveyButton>
        <SurveyButton
          selected={selectedButtons[3]}
          onClick={() => handleClick(3)}
        >
          활동형
        </SurveyButton>
      </SurveyContainer>
      <SurveyContainer style={{marginBottom:"15%"}}>
        <SurveyButton
          selected={selectedButtons[4]}
          onClick={() => handleClick(4)}
        >
          자연
        </SurveyButton>
        <SurveyButton
          selected={selectedButtons[5]}
          onClick={() => handleClick(5)}
        >
          도심
        </SurveyButton>
      </SurveyContainer>
      <Question>취향과 거리가 있는</Question>
      <Question>새로운 여행지를 추천받고 싶으신가요?</Question>
      <LikertContainer>
        <Message>늘 가던곳만 가고 싶어</Message>
        <Divider />
        <Message>취향과 상관이 전혀 없는 새로운 곳을 가고 싶어</Message>
      </LikertContainer>
      <LikertContainer style={{justifyContent:'space-between'}}>
        {[1, 2, 3, 4, 5].map((value) => (
          <LikertButton
            key={value}
            selected={selectedLikert === value}
            onClick={() => handleLikert(value)}
          />
        ))}
      </LikertContainer>
    </Container>
  );
};

export default TasteSurvey;
